import { __decorate } from "tslib";
import { Component } from '@angular/core';
let InicioAdministradorComponent = class InicioAdministradorComponent {
    constructor(router) {
        this.router = router;
    }
    ngOnInit() {
    }
    async loggear(values) {
        this.router.navigate(['/inicio-super-administrador']);
    }
};
InicioAdministradorComponent = __decorate([
    Component({
        selector: 'app-inicio-administrador',
        templateUrl: './inicio-administrador.component.html',
        styleUrls: ['./inicio-administrador.component.css']
    })
], InicioAdministradorComponent);
export { InicioAdministradorComponent };
